import React, { useState } from 'react';
import CalculatePrice from 'components/CalculatePrice/CalculatePrice';
import css from './TikTokLikesPage.module.css';

const TikTokLikesPage = ({ tiktokLikesData }) => {
  const [showPackages, setShowPackages] = useState(true);
  const [customQuantity, setCustomQuantity] = useState(0);
  const [priceDetails, setPriceDetails] = useState({
    newPrice: 0,
    oldPrice: 0,
    savings: 0,
  });

  const handlePriceChange = newPriceDetails => {
    setPriceDetails(newPriceDetails);
  };

  return (
    <div className={css.buyLikes}>
      <CalculatePrice
        data={tiktokLikesData}
        showPackages={showPackages}
        customQuantity={customQuantity}
        onPriceChange={handlePriceChange}
      />

      <div className={css.priceBlock}>
        <div className={css.mainPrice}>${priceDetails.newPrice.toFixed(2)}</div>
        <div className={css.oldPrice}>${priceDetails.oldPrice.toFixed(2)}</div>
        <div className={css.savings}>
          Youâ€™re saving{' '}
          <span className={css.savingsPrice}>
            ${priceDetails.savings.toFixed(2)}
          </span>
        </div>
      </div>
    </div>
  );
};

export default TikTokLikesPage;
